import React from "react";
import Comment from "./Comment";

const ApprovalCard = (props) => {
  return (
    <div className="card">
      <div class="content">
        <Comment name={props.name} date={props.date} text={props.text} />
      </div>
      <button>Accept</button>
      <button>Reject</button>
    </div>
  );
};

export default ApprovalCard;
